        <img
          className='porthole'
          src='https://media.giphy.com/media/3o85xJhackBStfkdBC/giphy.gif'
        />
      </div>
      <div className='centerer'>
        <p className='text one'>2020/10/05 17:00 UTC</p>
      </div>
      <div className='centerer'>
        <p className='text two'>2020/10/05 17:00 UTC</p>
      </div>
    </Layout>
  );
}

